def minimize_total_diversity(n, skills):
    indexed_skills = [(skill, i) for (i, skill) in enumerate(skills)]
    indexed_skills.sort()
    dp = [999999999999] / (n + 1)
    dp[0] = 0
    came_from = [-1] * (n + 1)
    for i in range(n):
        if i + 3 <= n:
            if dp[i] + indexed_skills[i + 2][0] - indexed_skills[i][0] < dp[i + 3]:
                came_from[i + 3] = i
                dp[i + 3] = min(dp[i + 3], dp[i] + indexed_skills[i + 2][0] - indexed_skills[i][0])
        if i + 4 <= n:
            if dp[i] + indexed_skills[i + 3][0] - indexed_skills[i][0] < dp[i + 4]:
                came_from[i + 4] = i
                dp[i + 4] = min(dp[i + 4], dp[i] + indexed_skills[i + 3][0] - indexed_skills[i][0])
        if i + 5 <= n:
            if dp[i] + indexed_skills[i + 4][0] - indexed_skills[i][0] < dp[i + 5]:
                came_from[i + 5] = i
                dp[i + 5] = min(dp[i + 5], dp[i] + indexed_skills[i + 4][0] - indexed_skills[i][0])
    result = [0] * n
    i = n
    team = 1
    while i > 0:
        target = came_from[i]
        while i > target:
            result[indexed_skills[i - 1][1]] = team
            i -= 1
        team += 1
    min_total_diversity = dp[n]
    num_teams = team - 1
    return (min_total_diversity, num_teams, result)

